window.bookSummaryJSON = "<p><b>A rebellious gang princess, four hot dangerous gangsters, one psycho stalker, and a revenge scheme that could destroy everything in Paradise Bend...</b></p> <p>My arranged marriage should have forged an alliance between my fiancé's gang and my father's. It turns out my fiancé had other plans.</p> <p>Like slaughtering my entire family the night before the wedding.</p> <p>I make it out alive, left with nothing but a thirst for vengeance. To crush the prick who betrayed me, I have to turn to the biggest pricks of them all.</p> <p>Hot, cocky, and dangerous, Wylder Noble and his men rule Paradise Bend. If I pass their brutal tests to prove I deserve their help, my ex doesn't stand a chance.</p> <p>But there are deeper troubles stirring in my hometown. While I try to figure out whether I'd rather kiss or kill my infuriating allies, I've got a deranged psycho leaving gruesome presents at my window. Outsiders are invading our streets, preparing for war.</p> <p>If they think our little county will be easy pickings, they couldn't be more mistaken. The Nobles are far from noble when tackling a threat, and I'm no damsel in distress.</p> <p>Before this is over, someone's going to bleed. And this time, it won't be me.</p> <p>Crooked Paradise is a complete gritty contemporary romance series from best-selling author Eva Chase (writing as Eva Chance) and Harlow King. This set contains all four books in the series: <i>Scorned Princess, Perilous Lady, Ruthless Queen</i>, and <i>Lethal Empress</i>.</p>"; 
